import React from "react";
import { Placeholder } from "react-bootstrap";

interface IInputData {
	label: string,
	type: string,
	id: any,
	placeholder: string,
}

const Input = ({ label, type, id, placeholder }: IInputData) => {
	return (
		<>
		// <div className="Input">
		<label>{label}</label>
		<input
			type={type}
			id={id}
			placeholder={placeholder}
		/>		
		// </div>
		</>
	)
}

export default Input;
